import React, { useEffect } from 'react' 
import { connect } from 'react-redux'
import {getGithub} from '../../actions.js/profile'


const ProfileGithub = ({username,repos,getGithub}) => {
    
    useEffect(()=>{
        getGithub(username);
    },[getGithub(username)])
    
    return <div>

    </div>
}

const mapStateToProps = state => ({
    repos : state.profile.repos,

})

export default connect(mapStateToPops,{getGithub})(ProfileGithub)
